import * as DeviceService from "../services/deviceService";
import {useCallback} from "react";

const useDeviceForm=()=>{
    const create = useCallback(async ({entity}) => {
            try {
                const response = await DeviceService.save(entity, "device");
                console.log("response=>", response);
            } catch (e) {
                console.log("error", e);
            }

            return response;
        },[]);
    return (create);
}

export default useDeviceForm;
